descr:
Ficarm apreendidos os produtos abaixo relacionados por serem considerados de origem clandestina, cuja procedencia nao possa ser comprovada:
01 - 60 (sessenta) frascos com cápsulas sem identificação ou quantidade, contendo drogas vegetais encapsuladas sem endereço, fabricante ou lote;
02 - Frascos com tinturas contendo suplementos com indicação terapêutica/medicamentos sem registro ou autorizados: (2) Cura vitiligo, (6) mel com babosa, (6) cura tudo, (8) Gastrite, (8) ervas do diabetes, (7) fel da terra, (8) cura fígado, (8) rabo de tatu e carqueja, (7) bom amargo, (8) raiz amarga, (9) aguardente alemã, (8) 37 ervas, (14) desinchá, (6) Detox, (8) Hibiscus, (9) cavalinha, (8) seca barriga, (9) Ypê rocho e Jatobá, (7) tribulus terrestris, (5) maca peruana, (2) amora, (2) chá de amora, (6) saúde da mulher, (5) Uxi Amarelo com unha de gato, (6) TPM, (7) Saude do homem, (4) Viagron natural, (6) Super vigor, (8) chá de oliveira, (8) Para pressão alta, (9) Urtiga, (9) Gingko biloba, (8) Circulação, (6) Moringa, (7) Folha Santa, (2) Raiz amarga, (3) Cura fígado, (5) gastrite, (3) seca barriga, (2) Elixir Inhame, (12) Cálculos renais.
